(2, 'Правила за сервиране', 'Сервирането на различните ястия предполага да познаваме чиниите и приборите, както и разположението им. За да направим изискана вечеря с гостите ни без да се изложим, ние трябва да знаем кое къде да сложим.\r\nНареждане на масата\r\n\r\n    В домашни условия за предпочитане е напитките да не се поставят върху масата за хранене, а върху малка помощна масичка или друга близка подходяща повърхност.\r\n    Желателно е всички прибори (съдчета) за подправки да бъдат поставени заедно на едно място, особено ако е комплект. Обикновено това място е в средата на масата.\r\n    Най-напред поставяме големият нож за основно ястие от дясната страна на определеното място за хранене на 1 см навътре от ръба на масата, вляво от него поставяме голямата вилица - за съответното ястие. Разстоянието между тях определяме, като завъртим ножа на 90 градуса, така че да стане успореден на ръба на масата, при това положение върхът на ножа определя мястото на вилицата, която също поставяме на 1 см навътре от ръба на масата. След това отдясно на ножа поставяме лъжицата за супа.\r\n    Ако в менюто има топло предястие, до големия нож поставяме среден нож, а ако топлото предястие е риба, слагаме нож, специален за риба.\r\n    Когато в менюто участва студено предястие (поднесени с аператива), средният нож се поставя отдясно на лъжицата за супа и с това завършва подреждането на приборите отдясно.\r\n    Отляво до голямата вилица поставяме средната вилица или вилицата за риба.\r\n    Десертните прибори подреждаме на масата след като почистим от всички употребени сервизи и прибори, непосредствено преди да поднесем десерта.\r\n    Добре подбраните сервизи и прибори за поднасяне на ястията внасят изисканост и красота, за да консумираме едно богато меню, са необходими както обикновени, така и по-специални прибори.\r\n    Обикновени прибори (нож, вилица и лъжица) в три размера - големи, средни и малки, всеки със своето предназначение.\r\n    С големите прибори консумираме всички видове основни ястия (с голям нож и голяма вилица) и повечето видове супи (с голяма лъжица).\r\n    Някои супи консумираме и със средна лъжица (крем супи, плодови супи) или с малка лъжица. Освен това с голяма лъжица и голяма вилица се прехвърлят ястия от платата в средата на масата в чиниите на хранещите се.\r\n    Средните прибори използваме при консумация на всички видове студени и топли предястия и някои десерти палачинки, баница (с нож и вилица); компот, ошав, кисело мляко (със средна лъжица).\r\n\r\nСервиране на аламинути\r\n\r\n    Аламинутите са основни ястия, чиято топлинна обработка е кратка - предимно пържене и печене на скара. Поднасяме в голяма плитка чиния както основните ястия.\r\n    Гарнитура, подредена красиво, поставяме отстрани в същата чиния.\r\n    Ако с аламинута поднасяме едновременно топла и студена гарнитура, топлата( пържени картофи, задушен грах, зелен фасул, ориз, моркови и др.) .\r\n    Поставяме в чинията с аламинута, а студената гарнитура (салата) поднасяме отделно в средна чиния, поставена отляво до върха на вилицата.\r\n    За да запазим високата температура на ястието по-дълго време, готовите аламинути поставяме в плато, чимбол (висока купа) или тенджера от йенско стъкло, неръждаема стомана или порцелан.\r\n    Този общ съд поставяме на средата на масата с голяма вилица или лъжица прехвърляне в предварително подредени индивидуални чинии.\r\n\r\nСервиране на студени и топли предястия\r\n\r\n    На обяд или вечеря започваме обикновено със студено предястие. Такива са: всички салати, млечни продукти, колбаси и месни специалитети, ордьоври, различни видове пити.\r\n    Студените предястия поднасяме индивидуално (поотделно) за всеки гост или в общи плата.\r\n    При индивидуалното сервиране пред всеки стол на масата оформяме куверт (място за хранене).\r\n    Отдясно поставяме среден нож, а отляво - средна вилица, на разстояние от ножа 25 см. Салфетката поставяме сгъната отляво на вилицата.\r\n    Студеното предястие поднасяме в средна чиния, която поставяме между ножа и вилицата. Възможно е студеното предястие да се състои от салата и ордьовър (или порция сирене, шунка и др.) поднесени в две отделни чинии.\r\n    Тогава чинията със салатата поставяме отляво на върха на вилицата, а чинията с ордьовъра (порцията сирене, шунка и др.) - между ножа и вилицата точно пред госта.\r\n    Когато студените предястия поднасяме в общи плата тип шведска маса, подреждането е както при индивидуалното сервиране на студено предястие, само че поставената средна чиния между ножа и вилицата е празна.\r\n    Платата със студените предястия подреждаме в средата на масата, като във всяко плато поставяме по една голяма вилица и една голяма лъжица, с помощта на които домакинята (или самите гости) си прехвърлят от ястията в празните чинии.\r\n    Сервиране на супи. Ако в менюто има супа при приборите отдясно на големия нож поставяме голяма лъжица. Супите сервираме в голяма дълбока чиния. Мястото на чинията за супа е между ножа и вилицата.\r\n    Ако супата е с месо с кости, до върха на вилицата поставяме средна или малка чинийка за отпадъци.\r\n    Най-удобно е супата да поднесем в супник чието място е близо до домакинята. В супника поставяме разливна супена лъжица, чиято дръжка сочи дясното рамо на домакинята което означава че тя ще разлива супата. Тя взема пред себе си всички чинии последователно, сипва супа и връща обратно.\r\n\r\nСервиране на основни ястия\r\n\r\n    Основните ястия поднасяме предварително сипани в голяма плитка чиния, която поставяме между големия нож и голямата вилица, и се консумира с тези прибори.\r\n    За да запазим по-дълго време високата температура на някои ястия, като агнешко със спанак, свинско със зеле, свинско с ориз, мусака и други, можем да поднесем в съдове от неръждаема стомана.\r\n    Не всички основни ястия обаче е подходящо поднасяне в такъв съд (например яхния, каша плакия и други).\r\n    Някои ястия от националната ни кухня - например, гювеч, стомна-кебап, каварма-кебап и други поднасяме направо в съда в който са приготвени.\r\n    Ако те са приготвени в общ гювеч или стомна, тези съдове се поставят в средата на масата и домакинята разсипва ястието с помощта на голямата лъжица.\r\n    Ако са приготвени в малки гювечета, те се поставят върху голяма плитка чиния, покрита с книжна салфетка.\r\n\r\nСалфетките и техния принос\r\n\r\nСалфетките са много важен елемент на масата за хранене. Освен за предпазване от изцапване, за изтриване на устата и в някои случаи на ръцете те са необходими и при поднасяне на хляб и прибори.\r\n\r\nНезависимо дали ще бъде поднесен в панерка или чинийка, хлябът трябва да бъде покрит със салфетка. Tази салфетка (за предпочитане платнена) се оформя на *пликче* като се сгъва на четири или по друг начин, поставя се в панерката или чинийката, повдига се само горният й край и се поставя хлябът, след което той се покрива отгоре с повдигнатия край на салфетката.\r\nПравила за готвене на тристепенно меню\r\n\r\nКогато имате гости у дома и решите да правите примерно супа, предястие и основно с гарнитура има няколко основни правила в готвенето, които известните шеф готвачи и кулинарията налагат.\r\n\r\n    Изберете добре менюто.\r\n    Проверете дали имате точните продукти.\r\n    Когато правите предястието и гарнитурата, в никакъв случай не трябва да има еднакви съставки.\r\n\r\nДавам примери:\r\n\r\n    предястие пилешки хапки и пиле с гъби в сос-основно ястие\r\n    супа, предястие с миш-маш и ястие с гарнитура чушка бюрек\r\n    супа с кисели краставички (аз правя такава), основно - руло Стефани и гарнитура към рулото кисели краставички\r\n\r\nАко допуснете тази грешка, няма да е фатално за вкуса, но пък гостите ви ще сметнат, че сте ограничени само с тези продукти, или че вашето въображение не може да измисли нищо друго.', 3, 1, '2015-07-27', NULL),
(3, 'Основни техники при готвенето', 'Много пъти съм се чудила какво ли означават определените наименования на начина на готвене на храната. С някои се сблъсках случайно, други научих, след като започнах да гледам кулинарни предавания на известни готвачи. За всички, които също като мен се чудят - ето и кои са различните начини за обработка на храната:\r\n\r\nВарене\r\n\r\nВаренето представлява равномерно нагряване на хранителните продукти до състояние на кулинарна готовност при пълно потапяне в течност (вода, бульон, мляко, захарен сироп) или среда, наситена с водна пара.\r\nЗадушаване\r\n\r\nПроцес, при който продуктите се нагряват в собствен сок или в малко количество течност до състояние на кулинарна готовност.\r\nПържене\r\n\r\nПроцес, при който хранителните продукти се довеждат до състояние на готовност чрез нагряване в мазнина с температура 150-190С, като се получава специфична коричка по повърхността на продукта.\r\nПечене\r\n\r\nПроцес, при който хранителните продукти се нагряват с горещ въздух (100-300 С) или с лъчиста енергия.\r\nЗапържване, попарване, пърлене\r\n\r\nИмат за цел да подпомогнат предварително обработване на хранителните продукти или да ги доведат до състояние на полуготовност. Включват запържване, попарване, пърлене и др.\r\nВарене на пара\r\n\r\nПродуктът се поставя в специална решетъчна приставка, подобна на тенджера. Обикновено тя е в комплект с основната тенджера, в която се кипва водата. Варенето протича задължително под капак, като приставката не бива да докосва водата. Практически почти всички видове зеленчуци и плодове са подходящи за този метод на топлинна обработка. Това е най-добрата техника за варене на продуктите, защото запазва техните хранителни вещества и витамини.\r\nЗапържване\r\n\r\nПредставлява кратковременно нагряване на хранителни продукти в мазнина. Мазнината, в която пържим, трябва да бъде нагорещена, кипнала. Всички мазнини разтопяваме при ниска температура, но възвираме само при висока.\r\nЗастройване\r\n\r\nКулинарна техника, с която се цели създаване на плътност и повишаване хранителната стойност на супи и сосове. Съществуват няколко вида: с яйца, с яйца и кисело мляко, с яйца, кисело мляко и брашно, с прясно мляко, с прясно мляко и яйца, със сметана, сметана и жълтъци и др. Продуктите се разбиват с тел и постепенно към тях се долива бульон от супата или сос, като по този начин се уеднаквява температурата. След това продуктите се връщат в готовата супа или сос и тенджерата се оттегля от огъня. Съществува и пресечена застройка, като се разбива яйце и през цедка се добавя към супата. Разбърква се непрекъснато, за да се получат *конци* от яйцето.\r\nБланширане\r\n\r\nИзразява се в кратковременно въздействие (1-5 минути) върху продуктите с кипяща вода или с пара.\r\nПърлене\r\n\r\nИзползва се, когато трябва да се изгорят малките косъмчета, останали по повърхността на трупа на птиците и на някои субпродукти след предварителното им обработване.\r\nСотиране\r\n\r\nБързо пържене в малко количество мазнина. Понякога под сотирани картофи в ресторантите се има предвид овкусени продукти с подправки, запържени леко на тиган.\r\nПаниране или темпура\r\n\r\nТехнологичен процес при приготвяне на ястия.\r\nПаниране\r\n\r\nМного често продуктите, преди да изпържим, панираме. Обикновената панировка правим с брашно.\r\n\r\nПанировката може да бъде с брашно, а след това и с яйце. Правим и още по сложно - от брашно, яйце, галета и пак яйце.\r\n\r\nПреди да панираме, продуктът го посоляваме. От високата температура на мазнината панировката веднага се запържва и не пропуска соковете навън, затова панираният продукт е по-сочен.\r\nПриготвяне на дресинг\r\n\r\nВсеки вид салатен сос в световната кухня се нарича дресинг. В практиката терминът се отнася най-вече към салатените сосове на майонезена или сметанова основа, както и към тези, приготвени от кисело мляко. Дресингът е средногъст сос. С него се подправят зеленчукови, месни и плодови салати. Има дресинги, които се поднасят и към печено пилешко месо или риба, както и към варени зеленчуци. Прието е всички дресинги на оцетена основа и растителна мазнина да се наричат винегрети, но има изключения. Така например съществуват салатени сосове, които на практика са винегрети, но се наричат дресинги - *Френч*, *Ароматен италиански*, *Цезар* и др.\r\nВинегрет\r\n\r\nСалатена заливка на основата на оцет и растителна мазнина. Използват се различни видове оцет - винен, ябълков, малинов, както и обогатените с различни билки и подправки оцети - естрагонов, с розмарин и др. Растителните мазнини са зехтин, слънчогледово, соево, фъстъчено, памуково, царевично олио и др. Класическото съотношение на оцет - мазнина при приготвянето на винегретите е 1:3, като се добавят различни билки, лимонена киселина, захар, кетчуп, горчица и др. Всички продукти се разбиват с тел до хомогенизирането на заливката.\r\nПечене в хартия/En papillote\r\n\r\nТова е стара френска техника, която вашите баби може би са пирготвяли преди много години и е известна и до днес. Опитвала съм яйце на хартия, директно печено на плоча.\r\n\r\n    Квадратно парче хартия за печене се сгъва на две и се изрязва във форма на сърце.\r\n    Продуктите се слагат до сгъвката в средата на сърцето.\r\n    Сърцето се запечатва, като се започне от острия край с двоен подгъв с дължина 3-4 см и ширина 1 см.\r\n    По същия начин се правят още няколко двойни подгъва.\r\n    Последният подгъв се прави в най-горната част на сърцето.\r\n    Запечатано от всички страни, ястието е готово за печене.\r\n\r\nТемпериране\r\n\r\nТова е друг топлинен процес при обработката на шоколад, при който крайният резултат е получаване на шоколадова фигура с определена кристална форма, или иначе казано, гланц, твърда структура и специфичен звук при разчупване. Два са основните методa за тампериране на шоколад: на мраморна плоча и с парченца шоколад.\r\nМариноване\r\n\r\nПриготвяне на парчета месо за следващата обработка на барбекю или фурна, повече можете да прочетете в тази статия - Съвети за избор, мариноване и готвене на риба\r\nПюриране\r\n\r\nНамачкване на вече сварени добре зеленчуци. Пюрирането на другите кореноплодни зеленчуци и тиквата се извършва с пасатора или блендера на кухненския робот.\r\n\r\n    За да се пюрират бобови зеленчуци или такива с фибри, като аспержите например, се използва специална ръчна мелница за зеленчуци или блендера.\r\n    За да се пюрират листните зеленчуци, първо им се отрязват дръжките и едрите жили, задушават се или се бланшират и се слагат в блендера. Преди и след пюриране трябва да се изстиска колкото е възможно повече вода от листата.\r\n\r\nПлънка\r\n\r\nКомбинация от продукти, предназначена за пълнене на сарми, пиле, риба и други ястия. Съществуват различни плънки от кайма и подправки, ориз и зеленчуци, от булгур, от колбаси и т. н. Някои видове се нуждаят от предварителна подготовка, други се омесват в сурово състояние.\r\nКанапе\r\n\r\nОснова от даден продукт, върху която се редят различни зеленчуци, колбаси, меса, риба и др. Най-популярни са канапетата от нарязани филии хляб или франзела, намазани с масло или пастет. След това върху тях се подреждат колбаси и сирене. Може да се оформи канапе от марули, както и от картофено пюре или сварен ориз, а върху тях да се подреди задушено или печено месо и да се полее със сос.\r\nРедуциране\r\n\r\nТова е друга новост, която се използва за придаването на по-голяма плътност на сосовете и до сега представлява класика в историята на кулинарните техники. Редуцирането представлява чисто и просто сгъстяване чрез варене на течности или сосове, в следствие на което вкусът и ароматът им се концентрира.\r\nФилетиране\r\n\r\nОтделяне на филето от костите при риби, пилешко, свинско, телешко месо, разрязване на ядки и др.\r\nПоширане\r\n\r\nВарене на продукт във вода или друга течност без кипване. Температурата е около 70-80С. Този метод на кулинарна обработка се използва за варене на деликатна риба, яйца и други бързо сваряващи се продукти.\r\nДегласиране\r\n\r\nРазтваряне на остатъците от даден продукт, полепнали при запържване по дъното на тиган или тенджера. Целта е да се използват в по-нататъшната обработка на ястието. Най-често се дегласира с вино, коняк или бульон. Д.Оливър използва много този метод и прави страхотни сосове грейви.\r\nКонкасе\r\n\r\n    Доматите се срязват на кръст от долната им страна.\r\n    Заливат се с вряща вода, докато се покрият.\r\n    След 10 секунди водата се излива и се слагат в съд със студена вода и лед, за да се спре топлинната обработка.\r\n    Обелват се от люспите и се срязват на четири.\r\n    С лъжица се отделят семките и сокът.\r\n    Месестата част се нарязва на тънки резени, които пък се нарязват напречно на малки кубчета.\r\n\r\nМакар че терминът може да се използва и за други зеленчуци или плодове, конкасе най-често се отнася за доматите, чиято месеста част, след почистване от люспата и семките, се нарязва на по-големи, средни или съвсем дребни кубчета.\r\n\r\nАко към френския класически сос Беарнез се добавят домати конкасе се получава соса Шорон, поднасян традиционно към печени риби или морски деликатеси.', 3, 1, '2015-07-27', NULL);

