INSERT INTO `basic_infos` (`id`, `title`, `info`, `picture`) VALUES
(1, 'Диабет втори тип', 'От диабет втори тип обикновено се разболяват хора в зряла възраст, най-често след 40 години. В много случай, появата му е свързана с повишаване на теглото. При затлъстяването се променя конфигурацията на клетъчните рецептори, към които трябва да се доближи инсулинът /хормонът регулиращ нивото на кръвната захар/ и те понижават чуствителността си спрямо него. Необходимо е по-голямо количество инсулин за да се преодолеят клетъчните рецептори, което води до повишено натоварване на жлезите, произвеждащи инсулин и намаляване на неговата секреция в бъдеще. Най-важното в профилактиката на диабета от този тип е поддържането на нормално телесно тегло. Неговото начало е по-слабо забележимо, затова хората със затлъстяване трябва перодично да контролират нивото на глюкозата в кръвта си. Редовните физически упражнения също помагат за намаляване на телесната васа и подобряват общото физическо състояние.\r\n\r\n', NULL),
(2, 'Диета при диабет', '\r\nГлавната й цел е да поддържа постоянно ниво на глюкозата в кръвта, максимално доближаващо се до нормата.\r\nПрепоръките по отношение на храненето при пациенти с нормално и наднормено тегло са различни.\r\nПри нормално тегло се препоръчва:\r\n–	да се избягват продукти, рязко повишаващи нивото на захарта. Към тях се отнасят захарните изделия, медът, плодовите сокове, сушените плодове.\r\n–	Да се консумират достатъчно количество растителна целулоза под формата на зеленчуци.\r\n–	Равномерно да се разпределя храненето в течение на деня. Денонощният порцион трябва да се разпредели на 4-5 приема, а не на 1-2.\r\nПри наднормено тегло на първо място е калоричността на порцията. Тя трябва да се намали за сметка на мазнините и алкохола. Показател за правилното хранене е намаляване на телсното тегло с до 1 кг на седмица. Във всекидневното меню трябва да се включват пресни зеленчуци и плодове – те са необходими за задоволяване на увеличената потпребност на организма от витамини и минерали.\r\n', NULL),
(3, 'Подсладители в кулинарията', 'Най-често използваният е захарта. Тя е главен източник на енергия на организма, променя качеството на храната и съдейства за по-продължителното съхраняване на някои продукти. Основните видове са бяла и кафява. В менюто на диабетици и хора с наднормено тегло се препоръчва да не се включват продукти, съдържащи захар. В тези случаи храната се приготвя  без захар с естествени подсладители като мед, кленов сироп, както и синтетични подсладители.', NULL),
(4, 'Мед', 'Медът е основният заместител на захарта в кулинарията. При печене свързва продуктите и подобрява качеството на сладкишите. Придава своеобразен вкус на ястията и сосовете. В комбинация с ябълков оцет и зехтин се използва за подправяне на салати.\r\nПоради по-високата си захарност в готварските рецепти може да се заменят 250 г захар с 150-200 г мед и съответно да се намали с 50 мл количеството течност.\r\nКогато се използва в кулинарията трябва да се има предвид, че при температура над 35 градуса по Целзий, губи много от аромата си, а при температура над 40 градуса, се разрушават много от ценните вещества, които съдържа. От меда продуктите бързо потъмняват и това е още една от причините да се готви на слаб огън.\r\nСамо 100 г мед са достатъчни да задоволят денонощната потребност на организма от ценни микроелементи, особено желязо, магнезий, манган, както и нуждата на мозъка и тялото да бъдат заредени с енергия.\r\n', NULL),
(5, 'Фруктоза', 'Фруктозата, съдържаща се в плодовете, растенията и меда е един от най-често използваните природни подсладители. Тя е двойно по-сладка от захарта, но има същата калоричност, т.е. 1 г от нея съдържат 4 kcal. Нейното основно предимство е ниският й гликемичен индекс. Може да се използва в диабетичното и диетичното хранене, но умерено – до 30 гр в денонощието, което не води до значително повишаване на глюкозата в кръвта.\r\nМеласата е друг заместител на захарта. Получава се след кристализирането на захарта от тръстиков или цвеклов сок. От тръстиковата меласа в комбинация с рафиниран сироп се прави петмез, използван за приготвянето на кексове и други тестени произведения.\r\nЗахарният петмез е източник на енергия и съдържа калций и желязо. Светлият петмез се получава като допълнителен продукт при рафинирането на захарта. Той е по-малко сладък от нея и няма такава хранителна стойност. Използва се главно за подслаждане на кексове и пудинги, сосове и плънки и някой видове хляб.\r\n115 г кафява захар се равняват на 85 г.  бяла захар или 2 с. л. Меласа или тъмно оцветен петмез.\r\n', NULL),
(6, 'Канела', 'Канелата понижава кръвната захар и се използва широко от диабетици и хора с повишен риск за развитие на диабет.\r\nКанела е широко разпространена подправка, която намира медицинско приложение при раздразнен стомах, диария и повишено натрупване на газове в червата и чувство на подуване. Канела се прилага също и като средство за стимулиране на апетита. Притежава антибактериални и противопаразитни свойства, които обуславят приложението при различни бактериални и паразитни инфекции.\r\n', NULL),
(7, 'Гликемичен индекс', 'Гликемичният индекс/GI/ показва с каква скорост даден продукт се превръща в глюкоза и постъпва в кръвния поток.  Съществуват различни начини за отчитане на гликемичния индекс в зависимост кои продукти – бял хляб, глюкоза, картофено пюре /нишесте/ - се вземат за база 100. Нашата таблица показва индекса по отношение на глюкозата, която се приема за 100, но в някои случаи случаи той е усреднен показател.\r\nНиският GI, под 50, предизвиква слабо покачване на кръвната захар.\r\nСредният GI, между 50 и 70 – е характерен за постепенното нарастване на кръвната захар.\r\nВисокият  GI, над 70, предизвиква взривно увеличаване на кръвната захар.\r\n\r\nДобри /сложни/ въглехидрати, GI под 50 – за разграждането им организмът изразходва повече време и енергия, задържат се по-дълго в него и така в кръвта по-бавно се освобождава глюкоза . След консумацията им се чувствате сити поне 3-4 часа между отделните хранения, енергични  и в добро здраве.  Съдържат се в бобовите и соевите храни, ядките, семената, триците, различните зеленчуци и плодове. Всички те са богати и на фибри, които се смятат за трудно смилаеми – например люспите на пшеницата, триците, обелките на ябълките и др. Необходимата за здравнословното хранене дневна доза целулоза е поне 30 грама дневно. За целта менюто ви всеки ден трябвад а съдържа – овесени ядки, мюсли, пектин, трици, моркови, броколи, ядки, сушени плодове, соя, пълнозърнести тестени изделия.\r\n\r\nЛоши / прости/ въглехидрати – това са продуктите, които се рзграждат много бързо и повишават рязко нивото на кръвната захар, предизвиквайки атаки на вълчи глад.\r\n', NULL);
INSERT INTO `basic_infos` (`id`, `title`, `info`, `picture`) VALUES
(8, 'Стевия', 'Зелената захар без калории\nВ естествен вид тя е 10-15 пъти по-сладка от захарта, екстрактът от нея под формата на стевиозид превишава 100-300 пъти сладостта на обикновената захар.\nНай-важното е, че тя не повишава нивото на кръвната захар, дори много изследвания са показали, че е два от метаболитите на растението нормализират нивото й.\nЗа разлика от повечето синтетични подсладители тя е абсолютно безвредна за организма дори и при продължителна употреба.\n–	подобрява работата на сърдечно-съдовата и имунната система;\n–	поради уникалната си способност да нормализира обмяната на веществата е безценен помощник в борбата със свръхтеглото и захарния диабет;\n–	нискокалоричен заместител на захарта. В организма на човека, тя не метаболизира, а се изхвърля в непроменен видм\n–	основните компоненти в съдържането й са сладките вещества, както и витамините В1, В2, Ср каротин, вит. РР, Е, З, флавониди,1 микроелементи, аминокиселини.\nОще в средата на миналия век в Парагвай и Бразилия е била създадена технология за извличане на сладкия екстракт от растението, която финансово се е конкурирала с производството на захар. Но по това време се появяват технологиите за производство на синтетични подсладители от нефтопродукти, което било значително по-евтино и естествено производителите на храни и напитки се ориентирали към тях – аспартам,  захарина, ацесулфам К.\nАко на опаковката не е посочено друго, може да използвате следните съотношения -\n1 таблетка стевия = 7-10 г захар /около 2 ч. л./\n1 капка течен екстракт стевия = 1,2 – 1,5 г захар\n6 капки течен екстракт стевия = 7,2 – 9 г захар /около 2 ч. л.захар/\n10 мл стевия = 400 – 500 г захар\n', );

